import './App.css';
import {initializeApp} from 'firebase/app';
import {getAuth, GoogleAuthProvider, signInWithPopup} from 'firebase/auth';
import {useAuthState} from 'react-firebase-hooks/auth';
import LoginBox from './Components/LoginBox';

const firebaseConfig = {
    apiKey: "AIzaSyD99Ps3ewiDL7WTtaCJaDqBmo5dmSRjuCo",
    authDomain: "cook-mastershare.firebaseapp.com",
    projectId: "cook-mastershare",
    storageBucket: "cook-mastershare.appspot.com",
    messagingSenderId: "901848339378",
    appId: "1:901848339378:web:ea76b02d8ef1cff6670aab",
    measurementId: "G-11NKHJEW95"
  };

let app = initializeApp(firebaseConfig);
let auth = getAuth(app);

export default function LoginPage({user, signInWithGoogle, email, password, signInWithEmail, showLogin, signInWithFacebook}){

    function signOut(){
        auth.signOut();
    }
    return (
        <div className='login-wrapper'>
            <LoginBox googleSignIn={signInWithGoogle} email={email} password={password} emailSignIn={signInWithEmail} showLogin={showLogin} signInWithFacebook={signInWithFacebook}/>
        </div>
    );
}
